DROP TABLE IF EXISTS PATIENTDETAILS;
CREATE TABLE IF NOT EXISTS PATIENTDETAILS(
   PatientNumber    INTEGER  NOT NULL PRIMARY KEY 
  ,PatientName      VARCHAR2(18) NOT NULL
  ,Address          VARCHAR2(28) NOT NULL
  ,City             VARCHAR2(28) NOT NULL
  ,Zip              VARCHAR(11) NOT NULL
  ,PhoneNum         VARCHAR(15) NOT NULL
  ,GUID             VARCHAR(36) NOT NULL
  ,Company          VARCHAR(36) NOT NULL
  ,RiskCategory     VARCHAR(36) NOT NULL
  ,PrimaryPhysician VARCHAR(28) NOT NULL
  ,DOB              VARCHAR(19) NOT NULL
  ,DIAG1CODE        VARCHAR(19)
  ,DIAG1DESC        VARCHAR(19)
  ,SUBABUSEIND      VARCHAR(19)
  ,SPL1CODE         VARCHAR(19)
  ,SPL1DESC         VARCHAR(26)
  ,SPL2CODE         VARCHAR(26)
  ,SPL2DESC         VARCHAR(32)
  ,SPL3CODE         VARCHAR(32)
  ,SPL3DEV          VARCHAR(26)
  ,COMORBIDIND      VARCHAR(25)
  ,LASTMODDATE      VARCHAR(19)
  ,GENDER           VARCHAR(19) NOT NULL
  ,FIELD24          VARCHAR(19)
  ,FIELD25          BIT 
);
